  const rows = [
    createData('101', 'Inhabitable', '27/04/2021', '3962', '', '96', ''),
    createData('102', 'Inhabitable', '27/04/2021', '3962', '', '96', ''),
    createData('103', 'Habitable',   '27/04/2021', '3962', '', '96', ''),
